import landing from './landing.svg';
import fdlogo from './fd_logo.svg';
import './App.css';
import React from "react";
import {useAuth0} from "@auth0/auth0-react";
import {Button, Toolbar, AppBar, IconButton, Typography} from "@material-ui/core";



const LoginButton = () =>{
    const { loginWithRedirect } = useAuth0();
    return <Button variant="contained"
                   color="primary"
                   size="large"
                   onClick={() => loginWithRedirect()}>Start working</Button>;
}
const LogoutButton = () => {
    const { logout } = useAuth0();

    return (
        <Button
            variant="contained"
            color="secondary"
            size="large"
            onClick={() => logout({ returnTo: window.location.origin })}>
            Log Out
        </Button>
    );
};
function UserBar(){
    return(
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start"  color="inherit" aria-label="menu">

                </IconButton>
                <Typography variant="h6">
                    News
                </Typography>
                <LogoutButton/>
            </Toolbar>
        </AppBar>
    );
}
function App() {
    const avatar = useAuth0().isAuthenticated ? "https://s.gravatar.com/avatar/afe5d2f67de43e86ffef7ac5661082bb?s=480&r=pg&d=https%3A%2F%2Fcdn.auth0.com%2Favatars%2Fma.png" : landing;
    const showBar = useAuth0().isAuthenticated ? <UserBar/> : "";
    return (
    <div className="Landing-page">
        <img src={fdlogo} className="FD-logo" alt="FranDine Company Logo"/>
        <img src={avatar} className="Landing-logo" alt="Company logo"/>
        <LoginButton/>
        {showBar}
    </div>

  );
}

export default App;
